import React from 'react';
import { useHistory } from 'react-router-dom'; // Import useHistory

import './Accueil.css'; // Adjust the path if necessary
import SportSeeLogo from '../../logo.svg'; // Adjust the path if necessary
import ButtonCircle from '../../components/ButtonCircle'; // Adjust the path if necessary

const Accueil = () => {
  const history = useHistory();

  const handleUserChange = (userId) => {
    history.push(`/profile/${userId}`);
  };

  return (
    <div className="accueil-container">
      <img src={SportSeeLogo} alt="SportSee Logo" className="logo" />

      <div className="button-container">
        <ButtonCircle label="12" onClick={() => handleUserChange(12)} />
        <ButtonCircle label="18" onClick={() => handleUserChange(18)} />
      </div>
    </div>
  );
};

export default Accueil;
